edition = "2023";

package google.internal.identity.accountsettings.mobile.v1;

import "google/internal/identity/accountsettings/mobile/v1/resource.proto";
import "google/internal/identity/accountsettings/mobile/v1/search_item.proto";
import "google/internal/identity/accountsettings/mobile/v1/help_center_search_item.proto";
import "google/internal/identity/accountsettings/mobile/v1/search_item_section.proto";

option objc_class_prefix = "ASM";

message SearchResponse {
	repeated Resource additional_resources = 2;
	repeated SearchItem search_items = 5;
	HelpCenterSearchItem help_center_search_item = 6;
	repeated SearchItemSection search_item_sections = 7;
}
